import React, { useState, useEffect } from "react";
import { Switch, Route } from "react-router-dom";
import Navbar from "../componets/Navbar";
import Navegation from "../componets/Navegation";
import { Examenes } from "./Examenes";
import Pacientes from "./Pacientes";
import { Registro } from "./Registro";
const Main = () => {
  const [modal, setmodal] = useState(false);
  const [accion, setAccion] = useState(1);
  let Documentos = [];
  function section() {
    switch (accion) {
      case 1:
        return <Examenes/>;
      case 2:
        return <Pacientes />;
      case 3:
        return <Registro/>;
      default:
        break;
    }
  }
  return (
    <div className="h-screen  overflow-hidden">
      <Navbar />

      <div className="flex flex-row bg-gray-300 max-h-full">
        <Navegation change={()=>setAccion} />

        <div className="w-full overflow-scroll overflow-x-hidden">
          {section()}
          <p>{accion}</p>
        </div>
      </div>
    </div>
  );
};

export default Main;
